import React from "react";
import ImgSlider from "./ImgSlider.jsx";
import styled from "styled-components";
import TraySlider from "./TraySlider.jsx";
const Home = () => {
  return (
    <Container>
      <ImgSlider />
      <TraySlider />
      <TraySlider />
      <TraySlider />
      <TraySlider />
    </Container>
  );
};

export default Home;
const Container = styled.div`
  position: relative;
  top: 80px;
  min-height: calc(100vh-80px);
  z-index: 1;
  padding: 0 40px;
  overflow: hidden;
`;
